async fn synthesize_speech(text: &str) -> Result<ElevenLabsResponse, Box<dyn Error>> {
    let api_key = "YOUR_ELEVENLABS_API_KEY";
    let client = reqwest::Client::new();
    let response = client
        .post("https://api.elevenlabs.io/v1/tts")
        .bearer_auth(api_key)
        .json(&serde_json::json!({ "text": text }))
        .send()
        .await?
        .json::<ElevenLabsResponse>()
