Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.api.java.function.PairFunction
import org.apache.spark.broadcast.Broadcast
import scala.collection.mutable.Map
import java.util.Date

// Define a case class to represent a cache entry
case class CacheEntry(query: String, timestamp: Date)

// Define a function to check if a query is in the cache
def isQueryInCache(query: String, cache: Broadcast[Map[String, CacheEntry]]): Boolean = {
  val cacheMap = cache.value
  val currentTime = new Date()
  val cacheEntry = cacheMap.get(query)
  if (cacheEntry.isEmpty) {
    false
  } else {
    val cacheTimestamp = cacheEntry.get.timestamp
    val twelveHoursAgo = new Date(currentTime.getTime - 12 * 60 * 60 * 1000)
    cacheTimestamp.after(twelveHoursAgo)
  }
}

// Define a function to update the cache
def updateCache(query: String, timestamp: Date, cache: Broadcast[Map[String, CacheEntry]]): Unit = {
  val cacheMap = cache.value
  cacheMap.put(query, CacheEntry(query, timestamp))
}

// Define a function to calculate the hit rate
def calculateHitRate(onsiteData: JavaRDD[String], topQueries: JavaRDD[String], cache: Broadcast[Map[String, CacheEntry]]): Double = {
  val hitRate = onsiteData.mapToPair(new PairFunction[String, String, Integer] {
    override def call(line: String): (String, Integer) = {
      val fields = line.split(",")
      val query = fields(0)
      val timestamp = new Date(fields(1).toLong)
      if (topQueries.value().contains(query) && isQueryInCache(query, cache)) {
        (query, 1)
      } else {
        updateCache(query, timestamp, cache)
        (query, 0)
      }
    }
  }).reduceByKey(_ + _).map(x => x._2).sum()
  val totalQueries = onsiteData.count()
  hitRate.toDouble / totalQueries
}

// Define the main function
def main(args: Array[String]): Unit = {
  val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()
  val sc = spark.sparkContext

  // Load the onsite attributed data
  val onsiteData = sc.textFile("onsite_data.csv")

  // Load the top frequent queries
  val topQueries = sc.textFile("top_queries.txt")

  // Create an empty cache
  val cache = sc.broadcast(Map[String, CacheEntry]())

  // Calculate the hit rate
  val hitRate = calculateHitRate(onsiteData, topQueries, cache)

  // Print the hit rate
  println(s"Hit rate: $hitRate")

  // Stop the Spark context
  sc.stop()
}
```
This job first defines a case class `CacheEntry` to represent a cache entry, which consists of a query and a timestamp. It then defines a function `isQueryInCache` to check if a query is in the cache, and a function `updateCache` to update the cache.

The main function loads the onsite attributed data and the top frequent queries, creates an empty cache, and then calls the `calculateHitRate` function to calculate the hit rate. The `calculateHitRate` function maps each line of the onsite attributed data to a pair of query and hit/miss indicator (1 for hit, 0 for miss), reduces the pairs by key to count the number of hits for each query, and then sums up the counts to get the total number of hits. It also updates the cache for each query that is not in the cache. Finally, it divides the total number of hits by the total number of queries to get the hit rate.

