Static variables and register variables are two types of variables in C programming language.

1. Static variables:
A static variable is a variable that has been allocated statically, i.e., at compile time. It retains its value between function calls and is initialized only once, at the beginning of the program. Static variables are declared using the keyword "static" before the variable name.

Here are some key points about static variables:

* They are initialized only once, at the beginning of the program.
* They retain their value between function calls.
* They have a default value of zero if not explicitly initialized.
* They have a local scope, i.e., they are only accessible within the function in which they are declared.
* They can be used to maintain state between function calls.

Example:
```c
#include <stdio.h>

void increment() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}
```
Output:
```
Count: 1
Count: 2
Count: 3
```
